class Solution {
public:
    // 94 99; 78 98; 94 99;
    string longestWord(vector<string>& words) {
        sort(words.begin(), words.end());
        words.erase(unique(words.begin(), words.end()), words.end());
        string ret = "", base = "", cur = "";   // base：增长的基准，局部最长
        for(int i = 0; i < words.size(); i++){
            cur = words[i];
            if(cur.size() == base.size() + 1 && cur.substr(0, base.size()) == base){   // 逐步增长
                base = cur;
            }else{  // 停止增长，寻找新的增长点
                if(ret.size() < base.size()){    // 暂停增长，局部最长
                    ret = base;
                }
                if(cur.size() <= base.size()){   // 寻找新的短的增长点
                    // base:abc 碰到 cur:ac, 新的增长点为 base:ac
                    // base:abc 碰到 cur:bc, 新的增长点为 base:""
                    // base:abc 碰到 cur:abd，新的增长点为 base:abd
                    // base:abc 碰到 cur:acd，新的增长点为 base:ab
                    int j = 0;
                    while(j < cur.size() && cur[j] == base[j]) j++;  // 必有不同，不会溢出
                    if(j == 0){
                        base = "";
                    }else{
                        if(cur.size() == j+1){
                            // base = cur.substr(0, j+1);
                            base = cur;
                        }else{
                            base = cur.substr(0, j);
                        }
                    }
                }
            }
        }
        if(ret.size() < base.size()){
            ret = base;
        }
        return ret;
    }

    // 88 99;
    string longestWord1(vector<string>& words) {
        stack<string> stk;
        sort(words.begin(), words.end());
        // cout << words << endl;
        string ret = "";
        string top = "";
        string cur = "";
        int i = 0;
        while(i < words.size()){
            // cout << i << endl;
            if(stk.empty()){
                if(words[i].size() == 1){
                    stk.push(words[i]);
                }
                i++;
                continue;
            }

            top = stk.top();
            cur = words[i];
            if(cur.size() == top.size() + 1 
                && cur.substr(0, top.size()) == top){
                stk.push(cur);
                // if(ret.size() < cur.size()){
                //     ret = cur;
                // }
                i++;
            }else{
                if(ret.size() < top.size()){
                    ret = top;
                }
                while(i < words.size()){
                    cur = words[i];
                    if(cur.size() == top.size()){   // 替换
                        if(cur.substr(0, top.size()-1) == top.substr(0, top.size()-1)){
                            stk.pop();
                            stk.push(cur);
                        }
                        i++;
                        break;
                    }else if(cur.size() < top.size()){   // 替换
                        while(!stk.empty()){
                            top = stk.top();
                            if(!(cur.size() == top.size() + 1 
                                && cur.substr(0, top.size()) == top)){
                                stk.pop();
                            }else{
                                break;
                            }
                        }
                        break;
                    }else{
                        // 不匹配
                        if(cur.size() > top.size() + 1 
                            || cur.substr(0, top.size()) != top){
                            i++;
                        }else{  // 匹配
                            break;
                        }
                    }
                }
            }
        }
        if(!stk.empty()){
            top = stk.top();
            if(ret.size() < top.size()){
                ret = top;
            }
        }
        return ret;
    }
};
